import React, { Component } from 'react';
import {Row, Col, CardImg, InputGroupAddon, InputGroup, InputGroupText, Input, InputGroupButtonDropdown} from 'reactstrap';
import Logo from "../assets/images/Logo_ML.png";
import Find from "../assets/images/ic_Search.png";

class Header extends Component{

    constructor(props) {
		super(props);
		this.toggle = this.toggle.bind(this);
		this.state = {
            isOpen:true,
		  dropdownOpen: false
		};
	}

	toggle() {
		this.setState({
		  dropdownOpen: !this.state.dropdownOpen,
		});
	}

	render(){
        const pos = {barr:{size: 10, offset: 1}, logo:"1", barSerch:"11"}
		return(
			<Row>
                <Col xs={pos.barr} sm={pos.barr} md={pos.barr}>
                    <Row>
                        <Col xs={pos.logo} sm={pos.logo} md={pos.logo} className="logo" >
                            <a href='/'>Donde comprar y vender<CardImg src={Logo}/></a>
                        </Col>
                        <Col xs={pos.barSerch} sm={pos.barSerch} md={pos.barSerch} className="barSearch">
                            <InputGroup>
                                <Input type="text" id="name" placeholder="Nunca dejes de buscar" defaultValue={this.state.search}/>
                                <InputGroupAddon addonType="prepend">
                                    <InputGroupText><CardImg width="100%" src={Find}/></InputGroupText>
                                </InputGroupAddon>
                            </InputGroup>
                        </Col>
                    </Row>
                </Col>
            </Row>
		)
	}
}

export default Header;
